    [],nt"num_tags": 9,nt"name": "initial-arctic-fox-eradication-program-on-amukta-island-aleutian-islands-alaska-1983",nt"isopen":
    false,nt"url": null,nt"notes": "The recent discovery of a second wild breeding
    population of the endangered Aleutian Canada goose (Branta canadensis leucopareia)
    on Chagulak Island suggested the possibility of natural expansion of geese to neighboring
    islands, if the introduced Arctic fox (Alopex lagopus) were eliminated. During the
    period of 17 May to 22 July 1983, the U. S. Fish and Wildlife Service conducted
    an eradication program on Arnukta Island, located about four miles southwest of
    Chagulak. Eradication of the fox was initially attempted using leghold traps, sodium
    cyanide devices (M-44 coyote getters), rifles, shotguns and a pistol. Diaphacinone
    poison baits were distributed across Amata along fox trails at the end of the season.
    Initial results appear promising with 49 fox being killed and all major fox trails
    revegetating by late summer. Previous eradication programs have succeeded on Agattu,
    Alaid-Nizki and Amchitka islands in the western Aleutians.",nt"owner_org":
